webpackJsonp([0x7950ff9e8d00],{561:function(A,e){A.exports={data:{markdownRemark:{html:'<p>A published an app, as a first version, it allows users to check for train schedule in the app.</p>\n<p>It looks like this, as of current writing of this blog.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/blog_screenshot-f1503fb33eb70d4396e34468ac24940d-dff1f.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 177.6315789473684%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="app_screenshot"\n        title=""\n        src="/static/blog_screenshot-f1503fb33eb70d4396e34468ac24940d-f8fb9.jpeg"\n        srcset="/static/blog_screenshot-f1503fb33eb70d4396e34468ac24940d-e8976.jpeg 148w,\n/static/blog_screenshot-f1503fb33eb70d4396e34468ac24940d-63df2.jpeg 295w,\n/static/blog_screenshot-f1503fb33eb70d4396e34468ac24940d-f8fb9.jpeg 590w,\n/static/blog_screenshot-f1503fb33eb70d4396e34468ac24940d-dff1f.jpeg 608w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<br />\n<h4>The good news</h4>\n<p>You don\'t have to write your own sdk wrapper library.</p>\n<p>There is already an open source library for you.</p>\n<p>If you are looking to integrate iPay88 into your react-native app, take a look at <a href="https://github.com/myussufz/react-native-ipay88-sdk">this library</a>.</p>\n<p>I must say it is an awesome work from the developer.</p>\n<br />\n<hr />\n<br />\n<h4>The bad news</h4>\n<p>You got to be extremely <strong>patience</strong>.</p>\n<p>Chances are, you are going to spent a lot of time to get your issue (not your ticket) resolved.</p>\n<p>So be earlier in your integration, do it as soon as possible!</p>\n<br />\n<hr />\n<br />',frontmatter:{date:"October 04, 2018",path:"/blog/offline-app-with-realm-db",title:"Going offline with Realm database",excerpt:"A different approach"}}},pathContext:{}}}});
